INSERT INTO musicbrainz.edit_note (id, editor, edit, text, post_time) VALUES (71025370, 1319473, 111451107, 'I have many of albums from Peter, Paul and Mary; as well as other appearances of them.  In the vast majority of cases - particularly on their own albums they use the word "and", not the ampersand "&" between Paul and Mary.  Based on this, I believe that the artist entry should be "Peter, Paul and Mary".  For the option of what names to change, I investigated which ones uses and changed the ones where the majority favor a change.  Unfortunately the one for "Peter, Paul & Mary" covers quite a few references, not all of which should have the name changed.  But changing the name is the right thing to do with the majority of cases.', '2024-05-03 23:08:39.802948+00');
