INSERT INTO musicbrainz.edit_note (id, editor, edit, text, post_time) VALUES (71025851, 2078154, 111451776, 'This is a bit of a funny one. They uploaded a download to Bandcamp on the 26th of this month, but the actual release is marked as the 24th of May. 

The blurb notes that the CD includes a code to download live tracks (the programme of this digital download is otherwise identical to the original CD release).

This suggests that they wlll upload more tracks close to the release date, or that they will make an additional digital release.

I think it is reasonable to consider the release on Bandcamp as-is a ''preview'' of the new release.

As such adding this for now for posterity, I will probably add the extra tracks as a new release.', '2024-05-04 00:14:50.676116+00');
